(11001, 'health', 'Supplements', '', '', '800mg/tablet, 60 tablets/bottle', 'Water-soluble pumpkin seed, Soybean germ extract (including 2% isoflavones)', 'This lipid-free, water soluble DLC Pumpkin Seed Formula is highly concentrated and is easily utilized by the body. Daily intake keeps you feeling young and active, supports bladder and prostate health, helps reduce occasional urinary urgency, incontinence episodes and frequency of midnight micturitions, promoting better sleep quality.\r\n<p><span>Special Feature:</span> This special variety of water soluble pumpkin seeds grown in Austria and manufactured in Switzerland, has gained more than 30 countries production patent... partner it with non-GMO soybean germ extract... natural bladder support for aging men and women.</p>\r\n<p><span>Suggested Intake: </span>Take 2 tablets daily</p>', 216, '11001.jpg', 1, 0, 0, 1, 1),
(11002, 'health', 'Supplements', '', '', '500mg/tablet, 60 tablets/bottle', 'Soybean germ extracts (with 40% isoflavones), Flaxseed extracts', 'Isoflavones are nutrients found in plants, most abundant in the germ, and can be found at the outer layer of soy bean germ.\r\n<p><span>Special Feature:</span> Only 1 kg of germ is produced from every 400 kg of soy bean. Soybean germ contains Isoflavones, Vitamin E, Lecithin, unsaturated fatty acids, and saponins... flaxseed contains high quantity of lignans and unsaturated fatty acids. This product contains special selected European soybean germ extracts (containing 40% isoflavones), non-GMO soy bean ingredients. Pure soy bean germ extract is the best nutritional supplement for women who wants to stay young.</p>\r\n<p><span>Suggested Intake:</span> Take 1 to 2 tablets daily</p>', 218, '11002.jpg', 1, 0, 0, 0, 1),
(11003, 'health', 'Supplements', '', '', '500mg/tablet, 60 tablets/bottle', 'Black Garlic, Blackcurrant extract, Hawthorn flower extract, Red grape leaf extract', 'This fermented Black Garlic Plus Formula contains 18 amino acids, vitamins, microelements, sulfur compounds, carbohydrates, minerals, etc. all with high nutritional values. It regulates metabolism and reduces tiredness.\r\n<p><span>Special Features:</span> Our specially selected Japanese patented \"<b><i>fermented black garlic</i></b>\" have passed thru a special process which have turned our fat soluble sulfides into water soluble sulfides. Because of this, the pungent smell of garlic has been eliminated. DLC Black Garlic Plus Formula contains 18 amino acids, vitamins, minerals, etc. all with high nutritional values.</p>\r\n<p><span>Suggested Intake:</span> 1 tablet daily before meals or as prescribed by your health practitioner</p>', 214, '11003.jpg', 1, 0, 0, 0, 1),
(11004, 'health', 'Health Packs', 'FR-82597', '', '800mg/tablet, 60 tablets/bottle x 4 bottles', 'Water-soluble pumpkin seed, Soybean germ extract (including 2% isoflavones)', 'This lipid-free, water soluble DLC Pumpkin Seed Formula is highly concentrated and is easily utilized by the body. Daily intake keeps you feeling young and active, supports bladder and prostate health, helps reduce occasional urinary urgency, incontinence episodes and frequency of midnight micturitions, promoting better sleep quality.\r\n<p><span>Special Feature:</span> This special variety of water soluble pumpkin seeds grown in Austria and manufactured in Switzerland, has gained more than 30 countries\' production patent... partner it with non-GMO soybean germ extract... natural bladder support for aging men and women.</p>\r\n<p><span>Suggested Intake: </span>Take 2 tablets daily</p>', 216, '11004.jpg', 1, 0, 0, 0, 0),
(11005, 'health', 'Health Packs', 'FR-82598', '', '500mg/tablet, 60 tablets/bottle x 4 bottles', 'Soybean germ extracts (with 40% isoflavones), Flaxseed extracts', 'Isoflavones are nutrients found in plants, most abundant in the germ, and can be found at the outer layer of soy bean germ.\r\n<p><span>Special Feature:</span> Only 1 kg of germ is produced from every 400 kg of soy bean. Soybean germ contains Isoflavones, Vitamin E, Lecithin, unsaturated fatty acids, and saponins... flaxseed contains high quantity of lignans and unsaturated fatty acids. This product contains special selected European soybean germ extracts (containing 40% isoflavones), non-GMO soy bean ingredients. Pure soy bean germ extract is the best nutritional supplement for women who wants to stay young.</p>\r\n<p><span>Suggested Intake:</span> Take 1 to 2 tablets daily</p>', 218, '11005.jpg', 1, 0, 0, 0, 0),
(11006, 'health', 'Supplements', 'FR-88508', NULL, '500mg/tablet, 30 tablets/bottle', 'Black Garlic, Blackcurrant extract, Hawthorn flower extract, Red grape leaf extract', 'This fermented Black Garlic Plus Formula contains 18 amino acids, vitamins, microelements, sulfur compounds, carbohydrates, minerals, etc. all with high nutritional values. It regulates metabolism and reduces tiredness.\r\n<p><span>Special Features:</span> Our specially selected Japanese patented \"<b><i>fermented black garlic</i></b>\" have passed thru a special process which have turned our fat soluble sulfides into water soluble sulfides. Because of this, the pungent smell of garlic has been eliminated. DLC Black Garlic Plus Formula contains 18 amino acids, vitamins, minerals, etc. all with high nutritional values.</p>\r\n<p><span>Suggested Intake:</span> 1 tablet daily before meals or as prescribed by your health practitioner</p>', 220, '11006.jpg', 1, 0, 0, 0, 0),
