(12001, 'health', 'Supplements', '', '', '1000mg/soft capsule, 60 soft capsule/bottle', 'Fish Oil (includes 290mg EPA, 190mg DHA, Vit. E)', 'Deep sea fish have been proven by the studies to be beneficial to health because it contains Omega-3 that has rich amounts of poly-unsaturated fatty acids. It can really be called the \"<b><i>Treasure of the Deep Sea</i></b>\"\r\n<p><span>Special Feature:</span> Deep sea fish oil is one of the best source of Omega-3 for people with deficient polyunsaturated fatty acids in their diet. The Heart Association has confirmed that EPA and DHA have numerous benefits for the cardiovascular system. This product which is rich in EPA and DHA is packed into the transparent soft capsules; each high quality capsule contains abundant nutrients, antioxidants and Vitamin E which helps promote one\'s health</p>\r\n<p><span>Suggested Intake:</span> For adults, take 1 to 2 soft capsules twice daily after meals<br>For children, take 1 soft capsule daily</p>', 210, '12001.jpg', 1, 0, 0, 0, 1),
