(13001, 'health', 'Supplements', 'FR-98155', '', '450mg/capsule, 60 capsules/bottle', 'Antrodia Cinnamomea powder', 'An indigenous fungus in Taiwan, also popularly known as the <b>\"Ruby in Taiwan\'s Forest\"</b>, Antrodia Cinnamomea contains highly nutritional ingredients that helps in the promotion of neurological &amp; cardiovascular health, and it is effective as immune-booster &amp; has anti-inflammatory properties.\r\n<p><span>Special Features:</span> This product, meticulously formulated, was granted double-patent, and contains more than 12% of polysaccharides, Super Oxide Dismutase (SOD), nucleic acid, vitamins, amino acids, etc. to regulate physiological functions and build up your nutritional health!</p>\r\n<p><span>Suggested Intake:</span> 1 capsule 2x a day before meals</p>', 228, '13001.jpg', 1, 0, 0, 0, 1),
(13003, 'health', 'Supplements', '', '', '1000mg/capsule, 60 capsules/bottle', 'BioCell Collagen Type II, Nano-Calcium, Glucosamine, Chondroitin, Vitamin D3, Olive Leaf Extract', 'Multiple bone protection and joint care formula - DLC Glucosamine Formula contains natural glucosamine, chondroitin, collagen peptide, vitamin D3 which can help improve absorption of calcium, nano-particled calcium which can maintain good health of bones and olive leaf extract.\r\n<p><span>Special Features:</span></p>\r\n<p>1. <b>BioCell patented Type II Collagen</b>, which has received 3 international patents, is safe and effective. The exclusive manufacturing method allows the ingredient to become small particles for speedy and effective absorption. The particles are now easier to be utilized by the body and have results unmatchable by other products, hence, healthier joints.</p>\r\n<p>2. For better absorption, we have added smaller particles <b>nano-calcium</b></p>\r\n<p>3. Olive trees are also known as the tree of life, rich in Oleuropein and Bioflavonoids. Our patent is <b>extracted from olive leaves</b>, the average concentration is 30% higher than olive fruits, a superb supplement for bones and joints.</p>\r\n<p>4. <b>Vitamin D3</b>: also known as the Sun Vitamin, assists with calcium absorption</p>\r\n<p><span>Suggested Intake:</span> 1 tablet 3x a day before meals</p>', 226, '13003.jpg', 1, 0, 0, 0, 1),
