(13006, 'health', 'Health Packs', 'FR-119217', 'http://www.fda.gov.ph/consumers-corner/registered-food-products/176489-fr-119217', '1000mg/capsule, 60 capsules/bottle x 4 bottles', 'BioCell Collagen Type II, Nano-Calcium, Glucosamine, Chondroitin, Vitamin D3, Olive Leaf Extract', 'Multiple bone protection and joint care formula - DLC Glucosamine Formula contains natural glucosamine, chondroitin, collagen peptide, vitamin D3 which can help improve absorption of calcium, nano-particled calcium which can maintain good health of bones and olive leaf extract.\r\n<p><span>Special Features:</span></p>\r\n<p>1. <b>BioCell patented Type II Collagen</b>, which has received 3 international patents, is safe and effective. The exclusive manufacturing method allows the ingredient to become small particles for speedy and effective absorption. The particles are now easier to be utilized by the body and have results unmatchable by other products, hence, healthier joints.</p>\r\n<p>2. For better absorption, we have added smaller particles <b>nano-calcium</b></p>\r\n<p>3. Olive trees are also known as the tree of life, rich in Oleuropein and Bioflavonoids. Our patent is <b>extracted from olive leaves</b>, the average concentration is 30% higher than olive fruits, a superb supplement for bones and joints.</p>\r\n<p>4. <b>Vitamin D3</b>: also known as the Sun Vitamin, assists with calcium absorption</p>\r\n<p><span>Suggested Intake:</span> 1 tablet 3x a day before meals</p>', 226, '13006.jpg', 1, 0, 0, 0, 0),
(14002, 'health', 'Supplements', 'FR-92004', 'http://www.fda.gov.ph/consumers-corner/registered-food-products/120923-fr-92004-120923', '500mg/tablet, 150 tablets/bottle', 'Blue-green algae', '<p><span>An excellent source of protein, plus an abundance of essential amino acids and gamma linolenic acids (GLA), this spiral-shaped blue algae is also rich in Vitamin B-complex, Vitamin A, and minerals like potassium, calcium, phosphorus, and magnesium. Thus, has earned the reputation for being the most complete nutritional health supplement, also popularly known as the Green Multi-Vitamin.</span></p>\r\n<p>Seafood is known for its high nutritional value and spirulina is a complete source of seafood. It\'s from the clean waters of Hawaii where it\'s known to have no pollution. Good for folks who enjoy dining out most of the time, as this supplement balances nutrients in our body. With long term use, one can maintain healthy digestive function, energizing and strengthening the body, and promotes long life.</p>\r\n<p><span>The difference...</span><br>\r\nâ€¢ The raw materials were carefully chosen from the\r\nworld\'s best spirulina producers in the United States<br>\r\nâ€¢ Our spirulina is grown in pollution-free Hawaii where it is bred and and cultured with 600 meter deep sea water, to ensure the cleanest, purest quality of spirulina<br>\r\nâ€¢ The special patented-freeze dried technology was\r\nused to ensure no part of this nutritious supplement\r\nbe lost in the production process</p>\r\n<p><i>Hawaiian Spirulina has</i><br><br>\r\n &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<b>670%</b> (6.7 times) more Protein than tofu<br>\r\n &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<b>300%</b> (3 times) more Calcium than whole milk<br>\r\n &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<b>5100%</b> (51 times) more Iron than spinach<br>\r\n &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<b>3100%</b> (31 times) more Beta-Carotene than carrots<br><br>3 grams of Hawaiian Spirulina = 5 servings of fruits and vegetables</p><p></p>', 212, '14002.jpg', 1, 0, 0, 0, 1),
(14003, 'health', 'Health Packs', 'FR-92004', 'http://www.fda.gov.ph/consumers-corner/registered-food-products/120923-fr-92004-120923', '500mg/tablet, 150 tablets/bottle x 4 bottles', 'Blue-green algae', '<p><span>An excellent source of protein, plus an abundance of essential amino acids and gamma linolenic acids (GLA), this spiral-shaped blue algae is also rich in Vitamin B-complex, Vitamin A, and minerals like potassium, calcium, phosphorus, and magnesium. Thus, has earned the reputation for being the most complete nutritional health supplement, also popularly known as the Green Multi-Vitamin.</span></p>\r\n<p>Seafood is known for its high nutritional value and spirulina is a complete source of seafood. It\'s from the clean waters of Hawaii where it\'s known to have no pollution. Good for folks who enjoy dining out most of the time, as this supplement balances nutrients in our body. With long term use, one can maintain healthy digestive function, energizing and strengthening the body, and promotes long life.</p>\r\n<p><span>The difference...</span><br>\r\nâ€¢ The raw materials were carefully chosen from the\r\nworld\'s best spirulina producers in the United States<br>\r\nâ€¢ Our spirulina is grown in pollution-free Hawaii where it is bred and and cultured with 600 meter deep sea water, to ensure the cleanest, purest quality of spirulina<br>\r\nâ€¢ The special patented-freeze dried technology was\r\nused to ensure no part of this nutritious supplement\r\nbe lost in the production process</p>\r\n<p><i>Hawaiian Spirulina has</i><br><br>\r\n &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<b>670%</b> (6.7 times) more Protein than tofu<br>\r\n &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<b>300%</b> (3 times) more Calcium than whole milk<br>\r\n &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<b>5100%</b> (51 times) more Iron than spinach<br>\r\n &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<b>3100%</b> (31 times) more Beta-Carotene than carrots<br><br>3 grams of Hawaiian Spirulina = 5 servings of fruits and vegetables</p><p></p>', 212, '14003.jpg', 1, 0, 0, 0, 0),
(15001, 'health', 'Functional Food', 'FR-85101', '', '2g/packet, 45 packets/box', 'Probiotic Strains:<br />\r\n<i>Lactobacillus acidophilus</i> (A),<br />\r\n<i>Bifidobacterium bifidum</i> (B),<br />\r\n<i>Bifidobacterium longum</i> (L),<br />\r\n<i>Lactobacillus casei</i> (C),<br />\r\n<i>Bifidobacterium infantis</i> (I),<br />\r\n<i>Lactococcus lactis</i> (LL),<br />\r\n<i>Lactobacillus plantarum</i> (LP),<br />\r\n<i>Lactobacillus rhamnosus</i> (LGG),<br />\r\nSkimmed milk powder, Lactose, Oligo, Xylooligosaccharide, Powdered sugar, Maltodextrin, Citric acid, flavoring. Contains more than 10billion live microorganisms per gram upon manufacture.', '<br>\r\nâ€¢ Patented multi-layer nano-crystal wrapping technology<br>\r\nâ€¢ Supplementing with Probiotics daily can improve the gut microbe environment.<br>\r\nâ€¢ The 8 strains of Probiotics aids in the maintenance of our digestive system regularizing bowel movement.<br>\r\nâ€¢ More than 10 billion live probiotic cultures in every gram, that is a total of 20 billion live probiotic cultures in every packet of DL7+1!<br>\r\n<p><span>Special Feature:</span> Developed and manufactured by a biotechnology factory specializing in probiotics with multiple certifications from GMP, FDA, IS09001, IS022001 and HACCP. Employs 8 strains of bacteria essential for gut health cultivated with compounded symbiosis. Compounded symbiosis can increase the probioticsâ€™ tolerance and has a higher survival rate when passing through stomach acid and bile.</p>', 250, '15001.jpg', 1, 0, 0, 0, 0),
(15003, 'health', 'Health Packs', 'FR-85101', '', '2g/packet, 45 packets/box x 4 boxes', 'Probiotic Strains:<br />\r\n<i>Lactobacillus acidophilus</i> (A),<br />\r\n<i>Bifidobacterium bifidum</i> (B),<br />\r\n<i>Bifidobacterium longum</i> (L),<br />\r\n<i>Lactobacillus casei</i> (C),<br />\r\n<i>Bifidobacterium infantis</i> (I),<br />\r\n<i>Lactococcus lactis</i> (LL),<br />\r\n<i>Lactobacillus plantarum</i> (LP),<br />\r\n<i>Lactobacillus rhamnosus</i> (LGG),<br />\r\nSkimmed milk powder, Lactose, Oligo, Xylooligosaccharide, Powdered sugar, Maltodextrin, Citric acid, flavoring. Contains more than 10billion live microorganisms per gram upon manufacture.', '<br>\r\nâ€¢ Patented multi-layer nano-crystal wrapping technology<br>\r\nâ€¢ Supplementing with Probiotics daily can improve the gut microbe environment.<br>\r\nâ€¢ The 8 strains of Probiotics aids in the maintenance of our digestive system regularizing bowel movement.<br>\r\nâ€¢ More than 10 billion live probiotic cultures in every gram, that is a total of 20 billion live probiotic cultures in every packet of DL7+1!<br>\r\n<p><span>Special Feature:</span> Developed and manufactured by a biotechnology factory specializing in probiotics with multiple certifications from GMP, FDA, IS09001, IS022001 and HACCP. Employs 8 strains of bacteria essential for gut health cultivated with compounded symbiosis. Compounded symbiosis can increase the probioticsâ€™ tolerance and has a higher survival rate when passing through stomach acid and bile.</p>', 250, '15003.jpg', 1, 0, 0, 0, 0),
(16003, 'health', 'Functional Food', '', '', '30mL/bottle', 'Green Propolis', 'The medical and therapeutic research team headed by Dr. Lee Hu had developed the most advanced liquified air to draw the propylene glycol USP from extracted bee propolis cube. It is different from the traditional extraction using alcohol, can be dissolved completely in water, and its flavonoids concentration is more than 28mg/ml.\r\n<p><span>Special feature:</span><br>\r\nâ€¢ Contains safe, stable USP, not extracted using alcohol<br>\r\nâ€¢ The International Food Chemistry Magazine featured an article from Japan Dao Tao University, that oral flavonoids (Bee Propolis), which has undergone propylene glycol USP process, has high absorption rate</p>\r\n<p><u>German Medical Dictionary hierarchy for quality of flavonoid bee propolis:</u><br>\r\na. flavonoids content 5mg/mL - 10mg/mL......regular/ordinary bee propolis<br>\r\nb. flavonoids content 10mg/mL - 15mg/mL....good bee propolis<br>\r\nc. flavonoids content 15mg/mL - 20mg/mL.....excellent bee propolis<br>\r\nd. flavonoids content 20mg/mL and above..... most outstanding bee propolis</p>\r\n<p><span>DLC Brazil Green Propolis contains more than 28mg/ml flavonoids!</span></p>\r\n<p></p>\r\n<p><span>Suggested Intake:</span> 10-15 drops of Brazil Green Propolis into your drinks (fruit juice, honey, tea, water) once or twice a day</p>', 270, '16003.jpg', 1, 0, 0, 0, 1),
(16004, 'health', 'Health Packs', 'FR-95229', 'http://www.fda.gov.ph/consumers-corner/registered-food-products/160291-fr-95229', '30mL/bottle x 4 bottles', 'Green Propolis', 'The medical and therapeutic research team headed by Dr. Lee Hu had developed the most advanced liquified air to draw the propylene glycol USP from extracted bee propolis cube. It is different from the traditional extraction using alcohol, can be dissolved completely in water, and its flavonoids concentration is more than 28mg/ml.\r\n<p><span>Special feature:</span><br>\r\nâ€¢ Contains safe, stable USP, not extracted using alcohol<br>\r\nâ€¢ The International Food Chemistry Magazine featured an article from Japan\'s Dao Tao University, that oral flavonoids (Bee Propolis), which has undergone propylene glycol USP process, has high absorption rate</p>\r\n<p><u>German Medical Dictionary hierarchy for quality of flavonoid bee propolis:</u><br>\r\na. flavonoids content 5mg/mL - 10mg/mL......regular/ordinary bee propolis<br>\r\nb. flavonoids content 10mg/mL - 15mg/mL....good bee propolis<br>\r\nc. flavonoids content 15mg/mL - 20mg/mL.....excellent bee propolis<br>\r\nd. flavonoids content 20mg/mL and above..... most outstanding bee propolis</p>\r\n<p><span>DLC Brazil Green Propolis contains more than 28mg/ml flavonoids!</span></p>\r\n<p></p>\r\n<p><span>Suggested Intake:</span> 10-15 drops of Brazil Green Propolis into your drinks (fruit juice, honey, tea, water) once or twice a day</p>', 270, '16004.jpg', 1, 0, 0, 0, 0),
(16005, 'health', 'Functional Food', '', '', '15g/sachet, 10 sachets/box', '120 different kinds of natural fermented powder of fruits and vegetables', '<br><b>Effective for health</b><br>\r\nâ€¢ Contains 120 enzymes of various kinds of fruits and vegetables<br>\r\nâ€¢ Completely fermented good bacteria flora for 540 days<br>\r\nâ€¢ Used extreme low temperature vacuum freeze dry crystal method (-20C) to preserve the life of the enzyme, thus still keeping the full nutritional value of each ingredient.<br>\r\n\r\n<br><b>Effective in Nutritional Value</b><br>\r\nâ€¢ Aside from providing protein, sugar, fats and the 3 basic decomposed enzymes- the Research &amp; Development team has developed the super micro element from an enzyme substance, which can supply all the nutritional needs of a single cell<br>\r\n\r\n<br><b>Effective for Staying Young</b><br>\r\nâ€¢ Contains abundant SOD-like enzymes, micro particles for easy absorption, plus fermented Vitamin B-complex, Vitamin C, and Vitamin E from fruits and vegetables, to help you stay young and energetic.<br>\r\n\r\n<br><b>Effective in Metabolism</b><br>\r\nâ€¢ Enzymes, water soluble dietary fiber, lactobacillus sporogenesis together promotes good bacterial flora which aids in easy digestion, making bowel movement smoother as it promotes healthy metabolism.<br>\r\n\r\n<br><b>Effective and Safe</b><br>\r\nâ€¢ On top of all the natural ingredients used in this product, one is assured that neither synthetic nor laxative drugs are added, thereby will not cause dependence.<br>\r\n\r\n<p><span>Suggested Intake:</span> Take 1 sachet after meal. Mix each sachet with 200-300 cc of cold water</p>', 252, '16005.jpg', 1, 0, 0, 0, 1),
(16006, 'health', 'Health Packs', 'FR-91926', 'http://www.fda.gov.ph/consumers-corner/registered-food-supplements/174191-fr-91926-174191', '15g/sachet, 10 sachets/box x 4 boxes', '120 different kinds of natural fermented powder of fruits and vegetables', '<br><b>Effective for health</b><br>\r\nâ€¢ Contains 120 enzymes of various kinds of fruits and vegetables<br>\r\nâ€¢ Completely fermented good bacteria flora for 540 days<br>\r\nâ€¢ Used extreme low temperature vacuum freeze dry crystal method (-20C) to preserve the life of the enzyme, thus still keeping the full nutritional value of each ingredient.<br>\r\n\r\n<br><b>Effective in Nutritional Value</b><br>\r\nâ€¢ Aside from providing protein, sugar, fats and the 3 basic decomposed enzymes- the Research &amp; Development team has developed the super micro element from an enzyme substance, which can supply all the nutritional needs of a single cell<br>\r\n\r\n<br><b>Effective for Staying Young</b><br>\r\nâ€¢ Contains abundant SOD-like enzymes, micro particles for easy absorption, plus fermented Vitamin B-complex, Vitamin C, and Vitamin E from fruits and vegetables, to help you stay young and energetic.<br>\r\n\r\n<br><b>Effective in Metabolism</b><br>\r\nâ€¢ Enzymes, water soluble dietary fiber, lactobacillus sporogenesis together promotes good bacterial flora which aids in easy digestion, making bowel movement smoother as it promotes healthy metabolism.<br>\r\n\r\n<br><b>Effective and Safe</b><br>\r\nâ€¢ On top of all the natural ingredients used in this product, one is assured that neither synthetic nor laxative drugs are added, thereby will not cause dependence.<br>\r\n\r\n<p><span>Suggested Intake:</span> Take 1 sachet after meal. Mix each sachet with 200-300 cc of cold water</p>', 252, '16006.jpg', 1, 0, 0, 0, 0),
(16009, 'health', 'Functional Food', 'FR-88905', '', '25g/sachet, 15 sachets/box', 'Skimmed milk powder, Soybean Protein, Corn Starch, Cabbage, Chicken meal, Onion powder, Carrots, Soluble Fiber (Maltodextrin), Potato Extract', 'This product is a delicious healthy meal that contains 30mg of patented potato extract called Potato Proteinase Inhibitor-II (PI2). This also contains soluble fiber digestive - resistant maltodextrin (Fibersol-2â„¢) that helps maintain intestinal regularity and has been used in many foods given FOSHU (Foods for Specified Health Uses) status in Japan.\r\n<p><span>Suggested Intake:</span> One sachet with 200-250 cc. of hot water (the amount depends on personal preference), stir and wait for 3-5 minutes. Enjoy!</p>', 254, '16009.jpg', 1, 0, 0, 0, 1),
(16010, 'health', 'Health Packs', 'FR-88905', '', '25g/sachet, 15 sachets/box x 4 boxes', 'Skimmed milk powder, Soybean Protein, Corn Starch, Cabbage, Chicken meal, Onion powder, Carrots, Soluble Fiber (Maltodextrin), Potato Extract', 'This product is a delicious healthy meal that contains 30mg of patented potato extract called Potato Proteinase Inhibitor-II (PI2). This also contains soluble fiber digestive - resistant maltodextrin (Fibersol-2â„¢) that helps maintain intestinal regularity and has been used in many foods given FOSHU (Foods for Specified Health Uses) status in Japan.\r\n<p><span>Suggested Intake:</span> One sachet with 200-250 cc. of hot water (the amount depends on personal preference), stir and wait for 3-5 minutes. Enjoy!</p>', 254, '16010.jpg', 1, 0, 0, 0, 1),
