(18001, '', '', 'FR-82597', '', '800mg/tablet, 60 tablets/bottle', 'Water-soluble pumpkin seed, Soybean germ extract (including 2% isoflavones)', 'This lipid-free, water soluble DLC Pumpkin Seed Formula is highly concentrated and is easily utilized by the body. Daily intake keeps you feeling young and active, supports bladder and prostate health, helps reduce occasional urinary urgency, incontinence episodes and frequency of midnight micturitions, promoting better sleep quality.\r\n<p><span>Special Feature:</span> This special variety of water soluble pumpkin seeds grown in Austria and manufactured in Switzerland, has gained more than 30 countries\' production patent... partner it with non-GMO soybean germ extract... natural bladder support for aging men and women.</p>\r\n<p><span>Suggested Intake: </span>Take 2 tablets daily</p>', 999, '18001.jpg', 1, 0, 0, 0, 0),
