(20001, 'skincare', 'DLC Beautiful Lifestyle Series', '', '', '155mL', 'Sodium lauryl isethionate, Cocamidopropyl betaine, Aloe barbadensis leaf extract, Glycyrrhiza glabra (Licorice) extract, Anthemis nobilis flower (Chamomile) extract, Honey extract, Maltitol, Sorbitol, Glycerin', 'Amino acids infused with plant extracts, the Revitalizing Cleansing Gel does not contain DEA, wont irritate your skin. The weak alkaline formula can dissolve makeup and dirt in the gentlest way. Let your daily skincare routine start with the all-natural and pure Revitalizing Cleansing Gel.<p></p>\r\n<p><span>Purpose:</span> Facial cleanser, revitalizes skin</p>\r\n<p><span>Does not contain:</span> Animal products, Mineral oil, Dimethicone, Chemically composed oil, Chemical paraben, Alcohol, Coloring, SLS (Sodium Lauryl Sulfate), Cocamide DEA</p>', 110, '20001.jpg', 1, 0, 0, 0, 1),
(20002, 'skincare', 'DLC Beautiful Lifestyle Series', '', '', '125mL', 'Dipotassium glycyrrhizate, Allantoin, Î²-Glucan, Hydrolyzed soy protein, Oryza sativa (Rice) bran extract, Calendula officinalis flower extract, Aesculus hippocastanum (Horse chestnut) seed extract, Panthenol, Niacinamide, Glycerin', 'Instantly repairs and supplies the skin with necessary nutrients. Refining &amp; Balancing Toner is a non-sticky one-step treatment to refresh and soften your skin.<p></p>\r\n<p><span>Purpose:</span> Clarify and tone</p>\r\n<p><span>Does not contain:</span> Animal products, Mineral oil, Dimethicone, Chemically composed oil, Chemical paraben, Alcohol, Coloring, SLS (Sodium Lauryl Sulfate), Cocamide DEA</p>', 111, '20002.jpg', 1, 0, 0, 0, 1),
(20003, 'skincare', 'DLC Aesthetic Lifestyle Series', 'NN-12-15890', '', '30mL', 'Palmitoyl pentapeptide-4, Palmitoyl tetrapeptide-3, Palmitoyl oligopeptide, Galactoarabinan, Dioscorea villosa (Wild yam) root extract, Centella asiatica extract, Ginkgo biloba leaf extract, Sodium hyaluronate', 'Improve the signs of aging. The concentrate contains peptide complex and precious plant extracts, greatly promotes your skin\'s overall health and youth.<p></p>\r\n<p><span>Purpose:</span> Prevent skin from aging and dehydration</p>\r\n<p><span>Does not contain:</span> Animal products, Mineral oil, Chemically composed oil, Alcohol, Coloring, Dimethicone, Fragrance, Anionic surfactant, Petro-chemical ingredients, Tretinoin, Medical anti-acne ingredients</p>', 132, '20003.jpg', 1, 0, 0, 0, 1),
(20004, 'skincare', 'DLC Beautiful Lifestyle Series', 'NN-09-12326', NULL, '60mL', '3-0-Ethyl ascorbic acid, CoQ10, Tocopheryl acetate, Ceramide, Rosa canina fruit oil, Dendrobium phalaenopsis flower extract, Corylus avellana (Hazel) seed oil, Simmondsia chinensis (Jojoba) seed oil, Hydrolyzed silk, Sodium PCA, Sodium hyaluronate, Glycerin', 'Anti-oxidant defense is the first step towards anti-aging. Providing the necessary ingredients that can be utilized by the skin is the basics in skin care. Regenerative Lotion contains natural anti-oxidants blended with high quality plant extracts and Ceramide, giving the skin all the nutrients to stay young and healthy.<p></p>\r\n<p><span>Purpose:</span> Anti-oxidant, fights against free radicals, keeps skin moisturized and radiant</p>\r\n<p><span>Does not contain:</span> Animal products, Mineral oil, Dimethicone, Chemically composed oil, Chemical paraben, Alcohol, Coloring, SLS (Sodium Lauryl Sulfate), Cocamide DEA</p>', 112, '20004.jpg', 1, 0, 0, 0, 0),
(20005, 'skincare', 'DLC Beautiful Lifestyle Series', 'NN-09-12329', NULL, '30mL', '3-O-Ethyl ascorbic acid, CoQ10, Tocopheryl acetate, Vitis vinifera (Grape) seed extract, Butyrospermum parkii (Shea butter), Calendula officinalis flower oil, Ceramide, Elastin, Hydrolyzed enteromorpha compressa, Tremella fuciformis sporocarop extract, Zizyphus Jujube fruit extract, Glycerin', 'Antioxidant defense is the first step towards anti-aging. Glycerin and vitamins can effectively repair dry skin; various anti-oxidants and plant extracts give a long lasting moisturizing effect. The end result - ageless radiant skin!<p></p>\r\n<p><span>Purpose:</span> Antioxidant, fights against free radicals, keeps skin moisturized and radiant</p>\r\n<p><span>Does not contain:</span> Animal products, Mineral oil, Dimethicone, Chemically composed oil, Chemical paraben, Alcohol, Coloring, SLS (Sodium Lauryl Sulfate), Cocamide DEA</p>', 113, '20005.jpg', 1, 0, 0, 0, 0),
(20006, 'skincare', 'DLC Beautiful Lifestyle Series', 'NN-12-10332', '', '120mL', 'Oleanolic acid, Nordihydroguaiaretic acid, Bacopa monniera extract, Hamamelis virginiana (Witch hazel) water, Dipotassium glycyrrhizate, Propylene glycol, Butylene glycol', 'Oily skin requires a special formula to normalize the skin and reduce pore size. Purifying Anti-Shine Toner is a soothing formula that makes skin look oil-free, smooth and flawless.<p></p>\r\n<p><span>Purpose:</span> Improve oily skin condition and tone, clarify skin, reduce pore size</p>\r\n<p><span>Does not contain:</span> Animal products, Mineral oil, Dimethicone, Chemically composed oil, Chemical paraben, Alcohol, Coloring, SLS (Sodium Lauryl Sulfate), Triclosan, Cocamide DEA, Tretinoin, Medical anti-acne ingredients</p>', 122, '20006.jpg', 1, 0, 0, 0, 0),
(20007, 'skincare', 'DLC Beautiful Lifestyle Series', 'NN-12-10330', '', '50mL', 'Hydrolyzed milk protein, Nordihydroguaiaretic acid, Oleanolic acid, Paeonia albiflora flower extract, Mentha piperita (Peppermint) leaf extract, Hamamelis virginiana (Witch hazel) water, Î²-Carotene, Spiraea ulmaria (Meadowsweet) leaf extract, Silica', 'Oily skin that is dehydrated? Control sebum to reduce visible shine! Oil-Control Hydrating Serum controls sebum production, creating the perfect environment to normalize oily skin. Hydration is vital to eliminating excess oils and clogged pores.<p></p>\r\n<p><span>Purpose:</span> Improve oily skin condition, maintain moisture, tone and clarify skin and pores</p>\r\n<p><span>Does not contain:</span> Animal products, Mineral oil, Dimethicone, Chemically composed oil, Chemical paraben, Alcohol, Coloring, SLS (Sodium Lauryl Sulfate), Triclosan, Cocamide DEA, Tretinoin, Medical anti-acne ingredients</p>', 123, '20007.jpg', 1, 0, 0, 0, 0),
(20008, 'skincare', 'DLC Aesthetic Lifestyle Series', 'NN-12-10333', 'http://www.fda.gov.ph/cosmetic-product-notification/30077-12-10333', '15mL', 'Dipeptide-2, Palmitoyl tetrapeptide-3, Palmitoyl pentapeptide-4, Palmitoyl oligopeptide, Palmaria palmata extract, Retinyl palmitate, Panthenol, Coenzyme Q-10 (Ubiquinone), Tocopheryl acetate, Algae extract, Sodium hyaluronate', 'Fine lines give away your age? Now you can reduce the signs of aging and enhance your skin\'s texture, well-being, and brightness. This advance anti-aging eye serum contains peptide complex, so skin is smoother, healthier, and more radiant!<p></p>\r\n<p><span>Purpose:</span> Reduce the appearance of wrinkles, skin discoloration, rough texture, and dehydration.</p>\r\n<p><span>Does not contain:</span> Animal products, Mineral oil, Chemically composed oil, Alcohol, Coloring, Dimethicone, Fragrance, Anionic surfactant, Petro-chemical ingredients, Tretinoin, Medical anti-acne ingredients</p>', 133, '20008.jpg', 1, 0, 0, 0, 1),
(20009, 'skincare', 'DLC Aesthetic Lifestyle Series', 'NN-12-12149', '', '125mL', 'Melaleuca alternifola (Tea tree) leaf oil, Mentha arvensis leaf oil, Niacinamide, Panthenol, Biotin', 'Amino acids infused with plant extracts, the Vigor Cleansing Mousse does not contain DEA or Triclosan. Blending natural tea tree oil with various plant extracts, we have created a mild alkaline formula especially for oily skin, leaving your skin refreshed and moisturized!<p></p>\r\n<p><span>Purpose:</span> Clean and tone the skin. Specially designed for oily skin</p>\r\n<p><span>Does not contain:</span> Animal products, Mineral oil, Dimethicone, Chemically composed oil, Chemical paraben, Alcohol, Coloring, SLS (Sodium Lauryl Sulfate), Triclosan, Cocamide DEA, Tretinoin, Medical anti-acne ingredients</p>', 121, '20009.jpg', 1, 0, 0, 0, 0);
