(20010, 'skincare', 'DLC Aesthetic Lifestyle Series', 'NN-09-12331', NULL, '25g, 5pcs/box', 'Transexamic Acid, 3-0-Ethyl ascorbic acid, Vitamin B3, Camelia sinensis leaf extract, Coix lacryma jovi seed extract, Glycyrrhiza glabra extract, Tremella fuciformis extract, Hyaluronic acid oligomer, Sodium PCA, Allantoin', 'Dry and dark skin? Unless you have fair skin, no amount of make-up will make you look beautiful. This product utilizes the soft comfortable micro-inject 3D fiber-weaved cotton to soak-up more essence. Especially chosen Tranexamic Acid, 3-0-Ethyl Ascorbic Acid, Vitamin B3, combined with multiple plant extracts, create fair and bright skin at once.\r\n<p><span>Purpose:</span> Whitens, moisturizes, leaves the skin radiant and translucent</p>', 192, '20010.jpg', 1, 0, 0, 0, 0),
(20011, 'skincare', 'DLC Aesthetic Lifestyle Series', 'NN-09-12340', NULL, '25g, 3pcs/box', 'Acetyl Hexapeptide-8, Tranexamic Acid, Tuber aestivum extract, Hydrolyzed elastin, Panax ginseng root extract, Hydrolysed silk protein, Vitamin B5, Allantoin', 'Roughness, wrinkles, lost elasticity and brightness... aging skin needs regular moisturizer and care. This product uses Biocellulose Fiber material, 3D structure that can attach to the skin closely, so the essences can penetrate deeply into the skin. Compound peptide controlling expression lines, algae extract, various amino acid and nutrients, rehydrating and whitening ingredients, provide the ultimate solution for your special skin care maintenance. Moisturizes, revitalizes, whitens, brightens, rehydrates. To make your skin smooth and full of youthful radiance.\r\n<p><span>Purpose:</span> Moisturizes, nourishes and revitalizes the skin, gives a whiter and radiant complexion</p>', 191, '20011.jpg', 1, 0, 0, 0, 0),
(20012, 'skincare', 'DLC Aesthetic Lifestyle Series', 'NN-12-10334', 'http://www.fda.gov.ph/cosmetic-product-notification/30078-12-10334', '30mL', 'Bacillus ferment', 'DLC\'s all new exfoliation formula! Bacillus ferment ingredient exfoliates for a smooth complexion, closes the pores. Welcome to a healthy skin, a healthy glow and a healthy you!<p></p>\r\n<p><span>Purpose:</span> Gently exfoliates. Prevents pores from clogging, increase skin radiance</p>\r\n<p><span>Does not contain:</span> Animal products, Mineral oil, Chemically composed oil, Alcohol, Coloring, Dimethicone, Fragrance, Anionic surfactant, Petro-chemical ingredients, Tretinoin, Medical anti-acne ingredients</p>', 131, '20012.jpg', 1, 0, 0, 0, 1),
(20013, 'skincare', 'DLC Aesthetic Lifestyle Series', '', '', '40mL', 'Titanium dioxide, Zinc oxide, Î±-Bisabolol, Ceramide 2, Jojoba oil, Ammonium glycyrrhizate, Allantoin, Yeast extract, Vitamin E, Zinc gluconate, Imperata cylindrical, Hyaluronic acid oligome, Mannose, micro-algae extract, Aesculus hippocastanum (Horse chestnut) extract', '<strong>SPF30 PA+++</strong>\r\n<p>Physical Sunscreen formula, weightless texture leaving your skin moisturized and toned. Hyaluronic acid, yeast extract, algae and other plant extracts can effectively protect your skin from the harmful sunlight as well as aging and dehydration, making your skin moisturized and protected from the possible dangers in the environment. Translucent sunscreen and silicone powder conceals wrinkles and fine lines.</p>\r\n<p><span>Purpose:</span> Facial sunscreen, corrects skin tone</p>', 143, '20013.jpg', 1, 0, 0, 0, 1),
(20020, 'skincare', 'DLC Aesthetic Lifestyle Series', '', '', '30mL', 'SK-influxâ„¢, Aquaxylâ„¢, Water-Hydrolyzed Corallina Officinalis Extract, Lactobacillus/Eriodictyon Californicum Ferment Extract, Rose Essential Oil, Ethylhexyl Olivate, Sodium Hyaluronate, Jojoba Oil, Î±-Bisabolol, Allantoin, Lumiskinâ„¢', 'Caress your skin and feel the rich and luxurious essence of <b>Aquaxylâ„¢</b>&nbsp;as it penetrates deep into each cell making your skin supple and hydrated. <b>SK-influxâ„¢</b>&nbsp;sheathes your skin immediately with a special protective layer, relishing every drop of water on your skin. The addition of Ethylhexyl Olivate, Rose Hips Oil, Lactobacillus/Eriodictyon Californicum Ferment Extract, Sodium Hyaluronate and <b>Lumiskinâ„¢</b>&nbsp;creates an even more radiant, supple and rosy skin.<p></p>\r\n<p><span>Purpose:</span> For dehydrated skin, to enhance rehydration</p>', 142, '20020.jpg', 1, 0, 0, 0, 1),
(20021, 'skincare', 'DLC Aesthetic Lifestyle Series', 'NN-1000000482876', 'http://www.fda.gov.ph/consumers-corner/cosmetic-product-notification/318288-NN-1000000482876', '32mL', 'Paeonia Suffruticosa Root Extract, Scutellaria Baicalensis Root Extract, Saxifraga Sarmentosa Extract, Arbutin, Acetyl Tyrosine, Glutathione, Aminopropyl Ascorbyl Phosphate, Tranexamic Acid, Î±-Lipoic acid, Dipotassium Glycyrrhizinate, D-Panthenol Vitamin B5, Eriodictyon Californicum Ferment Extract, Allantoin', '10-compound formulation, increasing the outer skin\'s ability to protect you against harmful elements in the environment and, at the same time, reinforces the ability of your skin to repair... making your skin white, vibrant, translucent and bright.<p></p>\r\n<p>Using the special whitening technology, it effectively reduces the darkening of the skin, and releases highly potent skin care ingredients. Continuous usage enables you to experience radiant glossy skin.</p>\r\n<p><span>Purpose:</span> Skin whitening, rehydration</p>', 141, '20021.jpg', 1, 0, 0, 0, 1),
(20022, 'skincare', 'DLC Aesthetic Lifestyle Series', '', '', '50mL', '<b>ReCCLR</b>â„¢, <b>Renovage</b>â„¢, <b>STEROCARE</b>â„¢, <b>ChroNOline</b>, <b>Idebenone</b>, <b>Dermaxyl</b>, <b>French Shea Butter</b> and <b>Brazilian Cupuacu Butter</b>, <b>Violet essential oil</b> and <b>Rose essential oil</b>, <b>ECOCERT Certified Organic Emulsifiers</b>', '<p><span>Four Skincare Factors</span><br>\r\nâ€¢ Skin Repair Factor - Bifidus Fermentation Extract (Repair Complex CLR) <b>ReCCLR</b>â„¢<br>\r\nâ€¢ Anti-aging Factor - <b>Renovage</b>â„¢<br>\r\nâ€¢ Moisturizing Factor - <b>STEROCARE</b>â„¢<br>\r\nâ€¢ Anti-wrinkle Factor - <b>ChroNOline</b></p>\r\n<p><span>Quadruple Repairing Essence</span><br>\r\nâ€¢ Anti-aging <b>Idebenone</b><br>\r\nâ€¢ Fine line smoothin peptide - <b>Dermaxyl</b><br>\r\nâ€¢ Highly moisturizing <b>French Shea Butter</b> and <b>Brazilian Cupuacu Butter</b><br>\r\nâ€¢ Aromatherapy - <b>Violet essential oil</b> and <b>Rose essential oil</b></p>', 150, '20022.jpg', 1, 0, 0, 0, 1),
