(31101, 'personal', 'Personal Hygiene Series', 'NN-09-12319', NULL, '250mL', 'Panthenol, Vitamin E, Hydrolyzed Wheat Protein and Glycerin', 'Long hours, pollution, sweat... What better way to recharge and refresh yourself than to shower with this multi-action shower shampoo that contains Vitamin E and Hydrolyzed Wheat Protein to cleanse you from head to toe.\r\n<p><span>Purpose:</span> shampoo to clean the scalp and bath gel to clean the body</p>\r\n', 361, '31101.jpg', 1, 0, 0, 0, 0),
(31102, 'personal', 'Personal Hygiene Series', 'NN-09-12315', NULL, '250mL', 'Panthenol, Silk protein, Vitamin E, Hydrolyzed wheat protein, Lavender essential oil', '<span>For ALL Hair Types</span><br>\r\nThinking of having beautiful and shiny hair? You need to have scalp and hair that is thoroughly and gently cleansed. The all purpose Deep Cleansing Daily Shampoo cleanses thoroughly. It contains vitamins and amino acids that moisturizes and cares for your hair and scalp. This gentle cleansing formula is gentle enough to be used daily while leaving your hair clean and healthy!\r\n<p><span>Purpose:</span> Gentle daily cleansing of hair and scalp</p>', 362, '31102.jpg', 1, 0, 0, 0, 0),
(31103, 'personal', 'Personal Hygiene Series', 'NN-09-12322', NULL, '250mL', 'Niacinamide, Panthenol, Vitamin E, Jojoba Oil, Hydrolyzed Wheat Protein, Lavender essential oil, Glycerin, Dipotassium glycyrrhizinate', 'With its non-silica formula, this conditioner leaves your hair shiny and silky, sans the damage. Frequent use makes nourished hair radiant and healthy, it prevents split-ends too!\r\n<p><span>Purpose:</span> Smoothens and nourishes hair, prevents split ends and breakage</p>\r\n', 363, '31103.jpg', 1, 0, 0, 0, 0),
(31104, 'personal', 'SPA Lavender', 'NN-09-12321', NULL, '270mL', 'Lavender essential oil, Biosaccharide Gum-1, Glycerin', 'The specially selected (Grosso) lavender essential oil relaxes your tired mind and body as you bathe in its fine bubbles. The moisture-retaining cleansing formulation removes dirt and grime, the rich and soft lather cleanses your skin.\r\n<p><span>Purpose:</span> Bath gel</p>\r\n', 371, '31104.jpg', 1, 0, 0, 0, 0),
(31105, 'personal', 'SPA Lavender', 'NN-09-12327', NULL, '260mL', 'Shea butter, Squalane, Algae extract, Dipotassium glycyrrhizinate, Trehalose, Î±-Bisabolol, Various plant extracts, Biosaccharide Gum-1, Glycerin, Hyaluronic acid, Lavender essential oil\r\n', 'Inspired by the tranquil fragrant garden paradise, we have carefully chosen the French lavender and Rex Rosemary essential oils to give you a refreshingly moisture-retaining lotion, leaving your skin shiny and supple.\r\n<p><span>Purpose:</span> Moisturizes dry and rough skin</p>\r\n', 372, '31105.jpg', 1, 0, 0, 0, 0),
(31106, 'personal', 'SPA Lavender', 'NN-12-10338', 'http://www.fda.gov.ph/cosmetic-product-notification/30082-12-10338', '700g', 'Lavender essential oil, Lavender flower, Sea salt, Sodium bicarbonate, Sodium chloride, Lavender essential oil, Mannitol, PEG-8, Laureth-9, Lavender flower', 'The specially selected (Grosso) lavender essential oil caresses away the tension of the day. The mild alkaline bath salts leave you with smooth and silky skin.\r\n<p><span>Purpose:</span> Relaxes and soothes, cares for the skin</p>\r\n', 373, '31106.jpg', 1, 0, 0, 0, 1),
(31107, 'personal', 'Rose Garden', 'NN-09-12317', NULL, '340mL', 'Disodium laureth sulfosuccinate, Sodium laureth sulfate, Olive oil, PEG-7 ester, Sodium hyaluronate, Tocopheryl acetate, Rose essential oil', 'Contains the ester of olive oil and delicate foam that will not wash away important skin lipids to keep you moisturized each time you bathe. Skin becomes silky\r\nsmooth, allowing you to have a luxurious bathing experience.\r\n<p><span>Purpose:</span> Bath gel</p>\r\n', 376, '31107.jpg', 1, 0, 0, 0, 0),
(31108, 'personal', 'Rose Garden', 'NN-09-12316', NULL, '340mL', 'Shea butter, Beeswax, Rose Hip oil, PEG-8 beeswax, Honey extract, Rose essential oil, Jojoba oil, Vitamin E, Niacinamide, Dipotassium glycyrrhizinate, Hyaluronic acid, Biosaccharide Gum-1, Î±-Bisabolol, Trehalose', 'Made from select high quality Bulgarian Rose Damask essential oil, combined with excellent moisturizers Rose Hip oil, Shea Butter, and beeswax to bring back the moisture to your skin. Protects against dry and cold weather with the excellent hydrating and moisturizing formula to give your skin that much needed care!\r\n<p><span>Purpose:</span> Moisturizes dry and rough skin</p>\r\n', 377, '31108.jpg', 1, 0, 0, 0, 0),
(31109, 'personal', 'Personal Hygiene Series', '', '', '250mL', 'Betaine type surfactant, panthenol, Vitamin E, Hydrolyzed wheat protein, menthol', '<p>A comprehensive 360-degree bathing experience, simple maintenance and high efficiency, satisfies the simple straightforward human nature, eliminating all the trivial complications, restores the energy of the skin and keeps you at your best condition.INSERT INTO `tblproducts` (`id`, `cat`, `subcat`, `pfda`, `fdalink`, `size`, `contains`, `description`, `sort_order`, `img`, `stock`, `promo`, `slp`, `feat`, `status`) VALUES
(35112, 'personal', 'Soap Travel Size', 'NN-1000003877468', 'https://ww2.fda.gov.ph/index.php/consumers-corner/cosmetic-product-notification/530236-NN-1000003877468', '150g x 3 bars / 24 slices', 'Palm kernel oil, Premium Coconut Oil, Sodium Hydroxide, Cymbopogon marginatus essential oil, Clinopodium douglasii essential oil, Citrus limonium essential oil', 'The relaxing and refreshing scent of Lemongrass and Yerba Buena deeply cleanses the skin and relieves tired body.&nbsp;<br>', 304, '35112.jpg', 1, 0, 0, 0, 1),
(35113, 'personal', 'Soap Travel Size', 'NN-1000000976221', 'http://www.fda.gov.ph/consumers-corner/cosmetic-product-notification/377087-NN-1000000976221', '150g x 3 bars / 24 slices', 'Palm kernel oil, Premium Coconut Oil, Sodium Hydroxide, Citrus aurantifolia essential oil, Cymbopogon marginatus essential oil, Pogostemon cablin essential oil', 'Especially formulated for oily skin, this refreshing soap can remove excess oil and clear up blemishes as it also whitens the skin.&nbsp;<br>', 306, '35113.jpg', 1, 0, 0, 0, 1),
(35114, 'personal', 'Soap Travel Size', '', '', '150g x 3 bars / 24 slices', 'Palm kernel oil, Premium Coconut Oil, Sodium Hydroxide, Santalum spicatum essential oil, Aloe barbadensis Mill. essential oil, Lawsonia inermis essential oil, Entada\r\nphaseikaudes K Meer bark bits', 'Enhanced with Gugo bark bits, Aloe Vera extract and Henna essential oil. This specialty shampoo bar nourishes the scalp and adds volume to fine limp hair.', 312, '35114.jpg', 1, 0, 0, 0, 1),
(35115, 'personal', 'Soap Travel Size', 'NN-1000000977019', 'http://www.fda.gov.ph/consumers-corner/cosmetic-product-notification/372431-NN-1000000977019', '150g x 3 bars / 24 slices', 'Palm kernel oil, Premium Coconut Oil, Sodium Hydroxide, Lilium candidum essential oil, Pogostemon cablin essential oil, Cucumis sativus essential oil', 'Discover the unique combination of freshness and nourishing care under the shower. The light fragrant scent of White Lily and Patchouli leaves your skin sweet-smelling and richly moisturized.&nbsp;<br>', 308, '35115.jpg', 1, 0, 0, 0, 1),
(35116, 'personal', 'Soap Travel Size', 'NN-1000003877282', 'https://ww2.fda.gov.ph/index.php/consumers-corner/cosmetic-product-notification/549200-NN-1000003877282', '150g x 3 bars / 24 slices', 'Palm kernel oil, Premium Coconut Oil, Sodium Hydroxide, Psidium guajava essential oil, Cucumis sativus essential oil', 'The rich, moisturizing ingredients of Guava and Cucumber nourishes and smoothens your skin, leaving a light refreshing scent.', 310, '35116.jpg', 1, 0, 0, 0, 1),
(35117, 'personal', 'Soap Collection', '', NULL, '', '3 travel size soap bars (x8 slices each)<br>\r\n1 Papaya with Milk<br>\r\n1 White Lily with Patchouli<br>\r\n1 Guava with Cucumber\r\n', 'Soothe the mind, body and soul with specially formulated soaps from DLC. Crafted with natural ingredients such as soothing white lily, pure essential oils of papaya or guava and healthy doses of vitamin-rich plant extracts, our all-natural soaps moisturize and pamper skin while lifting the senses, giving you a feeling of good health and well-being ...\r\n\r\n<p><span>Features of Naturelles</span></p>\r\n\r\n<p><span>ALL NATURAL and 0% Preservatives</span><br>\r\nOur natural soaps feature only premium essential oils and natural plant extracts to help rejuvenate, nourish and purify the skin. We assure you that none of these hazardous or synthetic ingredients such as parabens, sulfates, propylene glycol and synthetic colorants will touch your skin.</p>\r\n\r\n<p><span>100% Essential Oils</span><br>\r\nThe benefits of 100% essential oils with natural ingredients create a holistic approach to care for the senses and skin. Each variant is a sensory experience, simply created to let you enjoy a moment of serenity, clarity and luxury.</p>\r\n\r\n<p><span>The Purest of Ingredients</span><br>\r\nMade only from the finest ingredients, we created a naturally inspired collection of soaps for cleansing and moisturizing to keep your body healthy, energized and beautiful.</p>\r\n\r\n<p><span>Unique-patented floral mold</span><br>\r\nWith an eye for detail and craftsmanship, we carefully\r\ndesigned our soaps to minimize contact with water for longer use and enjoyment.</p>\r\n\r\n<p><span>Triple-milled</span><br>\r\nOur famous triple-milled soap are rich, luxurious, elegantly scented and long-lasting to nourish your skin and pamper your senses.</p>\r\n\r\n<p><span>6 Variants suitable for all skin-types</span><br>\r\nOur 6 variants were meticulously chosen to suit whatever your skin type is and enhance your bathing experience... making you feel pampered, nourished and moisturized.</p>', 321, '35117.jpg', 1, 0, 0, 0, 0),
