(40001, 'household', 'True Bio', '', '', '1500g', 'Sodium carbonate, Sodium sulfate, Soap powder, Fatty alcohol ethoxylated, Sodium percarbonate, Enzyme protein, Perfume', 'Effective natural cleansing formula; anti-bacterial; whitening, color enhancing and eco-friendly<br>\r\n1. Contains enzyme protein, natural soap powder and sodium percarbonate that deeply cleans and breaks down stains, leaving no residue on your clothes.<br>\r\n2. Perfect for delicate items as it contains no phosphors, fluorescence, chemical detergents nor chlorine bleach to ensure no harmful residue is left on your laundry.<br>\r\n3. Contains highly biodegradable ingredients replacing traditional granular surfactants, to protect your health and the environment.<br>\r\n4. Dissolves quickly, economical, easy to rinse thus saves water, very eco-friendly.<br>\r\n<p><span>Direction For Use:</span> Suggested usage applies to average wash: adjust according to\r\nnumber of items and degree of stain.</p>', 410, '40001.jpg', 1, 0, 0, 0, 1),
(40003, 'household', 'True Bio', '', '', '800mL', 'Alkylpolyglycosides (APG), Enzyme protein, Potassium sorbate, Citrus Aurantlum Dulcis (Orange) Oil, Anionic Surfactants', '<br>\r\nâ€¢ Food-grade ingredients, ensures your safety.<br>\r\nâ€¢ Has natural enzymes that quickly dissolve grease and clean hard-to-reach areas... rinses off easily, leaving no residue.<br>\r\nâ€¢ Non-irritating formula, safe and gentle on hands.<br>\r\nâ€¢ Main ingredient: APG (Alkylpolyglycosides) which has been certified by \"ECO\" as safe, natural ingredient.\r\n<p><span>Purpose:</span> For washing of dishes, utensils, pots and pans, etc.</p>\r\n<p><b>Note:</b> Please adjust the amount of dishwashing liquid according to the greasiness of the item to be washed.</p>', 410, '40003.jpg', 1, 0, 0, 0, 1),
(40006, 'household', 'True Bio', '', '', '400mL', 'Lappa extract, Lemon extract, Hops extract, Hypericum', 'Frequent hand washing is the most basic way to maintain your health. DLC Health Care Hand Wash is full of plant extract that is gentle on the hands, allowing the whole family to have soft and clean hands at all times.\r\n<p><span>Purpose:</span> Hand washing, leaving them supple and moisturized.</p>', 410, '40006.jpg', 1, 0, 0, 0, 1),
(41001, '', '', '', NULL, '', '', '', 999, '', 1, 0, 0, 0, 0),
(41002, 'household', 'True Bio', '', '', '550mL', 'Alkylpolyglycosides (APG), Enzyme protein, Potassium sorbate, Citrus Aurantlum Dulcis (Orange) Oil, Anionic Surfactants.', 'Main Ingredients:<br>\r\n1. Alkylpolyglycosides (APG) which has been certified by \"ECO\" as safe, natural ingredients. Other ingredients are the glucosides obtained from com, peanut, hydrolyzed wheat and coconut oil.<br>\r\n2. Contains natural plant extracts and food-grade ingredients... has no phosphors, added colorings and flavorings... no fluorescence or any harmful ingredients that might cause irritation.<br>\r\n3. Tested by Chang Gung University, College of Medicine, Graduate Institute of Natural Products, Natural Detergent for Fruits &amp; Vegetables is non-irritating on the skin, gentle on your hands.<br>\r\n4. Effective removal of any traces of pesticides, harmful chemicals or dirt from fruits and vegetables.\r\n<p><span>Purpose:</span> Effective removal of pesticides, harmful chemicals from fruits and vegetables. Can also be used for washing dishes and baby bottles.</p>', 410, '41002.jpg', 1, 0, 0, 0, 1),
(42001, 'household', 'Dr. Environment', '', '', '500mL', 'Lipase, Protease', '<br><span>â€¢ Contains lipase</span> that breaks down oil and stains in gaps and crevices, rinses off easily, no messy rubbing or scrubbing required.<br>\r\n<span>â€¢ pH-balanced formula</span>, colorless, odorless, non-corrosive and has no irritating smell, protects your kitchen and your family.<br>\r\n<span>â€¢ Safe and eco-friendly</span>, non-toxic, suitable to clean kitchen, furniture, glass, screens and even unclogs drains.<br>\r\n<p><span>Purpose:</span> Breaks down oil stains in the kitchen, cleans furniture and lamp shades, cleans walls, windows and screens, even gets rid of oil on motor vehicles</p>', 420, '42001.jpg', 1, 0, 0, 0, 1),
(42002, 'household', 'Dr. Environment', '', '', '800mL', 'Lipase, Protease', '<br>\r\n<span>â€¢ Contains unique enzyme called protease</span> that breaks down sweat, blood and food\r\nstains.<br>\r\n<span>â€¢ Contains lipase</span> to remove oil, makeup or food stains on collars and sleeves.<br>\r\n<span>â€¢ Gentle and pH-balanced</span>, hypoallergenic, gentle on delicate items. Suitable for your undergarments and special fabrics, even for infant clothing.<br>\r\n<span>â€¢ Safe and eco-friendly</span>, non-toxic, contains no Nonoxynol, phosphors and fluorescence, at least 97% bio-degradable.<br>\r\n<p><span>Purpose:</span> To wash delicate items, infant clothing, day-to-day clothes and GORE-TEX items</p>', 420, '42002.jpg', 1, 0, 0, 0, 1),
(42003, 'household', 'Dr. Environment', '', '', '1000mL', 'Protease, Lipase, Pine Oil, Lavender Oil', '<br><span>â€¢ Contains lipase</span> to cleverly dissolve oil and stains on the floor.<br>\r\n<span>â€¢ Contains protease</span> to remove food stains from the floor.<br>\r\n<span>â€¢ Contains unique natural plant extracts</span> to break down cell membranes of bacteria<br>\r\nand fungi, achieving anti-bacterial, odorless and dust mite-free environment without using chemicals.<br>\r\n<span>â€¢ Suitable for any type of floors:</span> ceramic, granite, marble, vinyl, wood. Cleaning, disinfecting and polishing in just one step has never been so easy.\r\n<p><span>Purpose:</span> Cleaning of all types of flooring, including tiles, granite, vinyl, marble, washouts and wood</p>', 420, '42003.jpg', 1, 0, 0, 0, 1),
(42004, 'household', 'Dr. Environment', 'HSR-5775', 'http://www.fda.gov.ph/consumers-corner/registered-household-hazardous/44348-hsr-5775', '150mL', 'Micro-scrub particles', '<br><span>â€¢ Special scrubbing particles</span> that easily removes stubborn paint, ink and other stains.<br>\r\n<span>â€¢ Contains natural gum</span>, safe and eco-friendly.<br>\r\n<span>â€¢ Speedy cleaning power:</span> Suitable for markers, coloring pen, ink, paint, various sticky stains.<br>\r\n<span>â€¢ Contains fine sand crystals:</span> does not scratch surfaces, melts and removes stains, rinses off easily.<br>\r\n<span>â€¢ Gentle, non-irritating, neutral pH formula</span> to protect both your hands and the environment, non-toxic.\r\n<p><span>Purpose:</span> Removes EPOXY, paint, resin, ink on whiteboards, cabinets, tables or walls\r\nand tile stains. Can also be used as hand wash after heavy-duty work.</p>', 420, '42004.jpg', 1, 0, 0, 0, 1),
(52001, 'personal', 'Soothing and Relaxing', 'NN-12-10340', 'http://www.fda.gov.ph/cosmetic-product-notification/30084-12-10340', '21g', 'Sweet almond oil, Apricot kernel oil, Rosehip oil, jojoba oil, Sunflower seed oil, Vitamin E, Shea butter, Precious rose oil, Chamomile, Sweet orange, Spearmint, Beeswax.', 'With countless chores leaving your hands dry and rough, flaky dry heels that stand out with the newly-bought flip-flops... this special product contains 100% herbal shea butter which is the solution to excellently repair extremely dry skin.\r\n<p><span>Purpose:</span> Gentle natural formula is non-irritating, soothes &amp; relaxes the skin.</p>\r\n<p><span>Direction For Use:</span> Apply thin layer where needed massage until absorbed.</p>\r\n', 380, '52001.jpg', 1, 0, 0, 0, 1),
(52002, 'personal', 'Soothing and Relaxing', 'NN-12-10336', '', '21g', 'Natural essential oils: Sweet almond oil, Apricot kernel oil, Wheat germ oil, Vitamin E, Lavender, Rosewood oil, Beeswax', 'This unique aroma essential oil formula soothes the tired mind with its calming effect, gentle also on the skin because of its fine ingredients.\r\n<p><span>Purpose:</span> Soothing on the skin, relaxing the mind.</p>\r\n<p><span>Direction For Use:</span> Massage gently</p>', 380, '52002.jpg', 1, 0, 0, 0, 0),
(52003, 'personal', 'Soothing and Relaxing', 'NN-20131029143243', 'http://www.fda.gov.ph/cosmetic-product-notification/124740-nn-20131029143243', '21g', 'Wheat germ oil, Vitamin E, Hypericum oil, Sunflower oil, White Willow Bark, Menthol, Angelica oil, Eucalyptus oil, Rosemary oil, Peppermint, Beeswax', 'Enjoy the soothing aroma and relaxed feeling whenever\r\nyou open a canister of this ointment.\r\n<p><span>Purpose:</span> Gentle natural formula is non-irritating, soothes &amp; relaxes the skin.</p>\r\n<p><span>Direction For Use:</span> Apply thin layer where needed, massage until absorbed.</p>', 380, '52003.jpg', 1, 0, 0, 0, 1),
(52004, 'personal', 'Soothing and Relaxing', 'NN-09-12323', NULL, '21g', 'Natural essential oils: Tea Tree oil, Sunflower oil, Bergamot, Peru Balsam, Wheat germ oil, Vitamin E, Hypericum oil, Calendula oil, Niaouli, Eucalyptus oil, Peppermint, Beeswax\r\n', 'This herbal ointment is your purse\'s best friend. Contains only all natural herbal ingredients and essential oils, it is non-irritating and non-sticky. Ideal for the use of the whole family!\r\n<p><span>Purpose:</span> Gentle natural formula is non-irritating for adult and kids, the perfect ointment to have in the house.\r\n</p><p><span>Direction For Use:</span> Apply thin layer where needed, massage until absorbed.</p>', 380, '52004.jpg', 1, 0, 0, 0, 0),
(52005, 'personal', 'Soothing and Relaxing', 'NN-09-12336', NULL, '21g', 'Natural essential oils - Sweet almond oil, Jojoba oil, Sunflower seed oil, Vitamin E, Precious rose oil, Tea rose oil, Beeswax', 'This pure rose fragrance is a sensory experience, simply created to pamper and surround you with the luxurious scent of rose bouquet the whole day through!\r\n<p><span>Purpose:</span> To surround yourself with the fragrance of roses all day long!</p>\r\n<p><span>Direction For Use:</span> Apply on wrists, behind the ears, neck or wherever you wish.</p>\r\n', 380, '52005.jpg', 1, 0, 0, 0, 0),
