(53001, 'personal', 'Oral Hygiene Series', '', '', '130g', 'Potassium nitrate 0.5%, Chlorhexidine 0.2%, Sodium monofluorophosphate (1000ppm)', 'Contains safe and gentle, yet highly effective formula\r\n(potassium nitrate, natural tea tree oil and bee propolis) to help fight cavities and tooth decay<br>\r\nâ€¢ Helps strengthen tooth enamel<br>\r\nâ€¢ Repairs damaged enamel<br>\r\nâ€¢ Prevents gum problems<br>\r\nâ€¢ Relieves sensitivity of toothache caused by drinking hot or cold beverages<br>\r\nâ€¢ does not contain SLS, Triclosan, Diethylene glycol<br>\r\n<p><span>Note:</span> Children below 6 years of age should reduce the quantity of use. Adult supervision is highly recommended. If problem persists, consult your dentist.</p>', 391, '53001.jpg', 1, 0, 0, 0, 1),
(53002, 'personal', 'Oral Hygiene Series', '', '', '4 pcs/box', '', '<p><span>â€¢ 3D Extreme Soft Bristle</span><br>\r\nThe DuPont tipped filament patented fiber 3D bristle was manufactured using West German technology through a 7-step abrasion process to achieve the softness of the bristles. The toothbrush has been carefully researched to care for our enamel, and truly meet the professional dentist\'s recommended brushing method.</p>\r\n<p><span>â€¢ Small-brush head</span><br>\r\nTailor-made brush head is specially-designed to clean hard-to-reach areas in our mouths, keeps teeth healthy and clean.</p>\r\n<p><span>â€¢ Specially-designed super thin brush neck</span><br>\r\nThe thin-angled neck is especially designed to make brushing more comfortable. No need to open the mouth too wide.</p>\r\n<p><span>â€¢ Transparent elastic and special non-skid thumb design</span><br>\r\nEven with improper force used during brushing, this tooth brush can reduce impact and cushion to protect our sensitive gums from being damaged.</p>\r\n<p><span>Suggested usage:</span><br>\r\nTo effectively prevent and improve gingivitis and sensitive teeth problems, use Diamond Shine Daily Tooth gel on the Diamond Shine Toothbrush using the proper brushing techniques.</p>\r\n<p>*Dentist\'s recommendation: Brush after meals, each time at least 3-5 minutes. Change your toothbrush every 2 months.</p>', 393, '53002.jpg', 1, 0, 0, 0, 1),
