(20016, 'skincare', 'DLC Aesthetic Lifestyle Series', '', '', '', 'Algae Extract, Hydrolyzed Rice Bran Protein, Soy Protein, Oxidoreductase, Glycosyl Trehalose, Saccharide Isomerate, Chrysin, Palmitoyl oligopeptide, Palmitoyl Tetrapeptide-3, Niacinamide, Ammonium Glycyrrhizate, Horse Chestnut Extract, Allantoin, Sinorhizobium Meliloti Ferment Filtrate', 'Firms skin around eye area, effectively improves the dark circles around the eyes.', 161, '20016.jpg', 1, 0, 0, 0, 1),
(20017, 'skincare', 'DLC Aesthetic Lifestyle Series', '', '', '', 'Acetyl Tetrapeptide-9, Acetyl Hexapeptide-37, Acetyl Dipeptide-1 Cetyl Ester, Oat Beta Glucan, Phytessence Wakame, Dipotassium Glycyrrhizinate, Provitamin B5 D-Panthenol, Hyaluronic acid', 'Effectively firms skin, making the skin appear more plump and supple.<br>', 162, '20017.jpg', 1, 0, 0, 0, 0),
(20018, 'skincare', 'DLC Aesthetic Lifestyle Series', '', '', '', 'Bacillus Ferment, Distilled Water, Propylene Glycol, Keratoline, Olive Oil PEG-7 Esters, Phenoxyethanol, D-Panthenol, Allantoin, Methylisothiazolinone.', 'Gently exfoliates, prevents clogged pores.<br>', 160, '20018.jpg', 1, 0, 0, 0, 1),
