(52009, 'personal', 'Personal Hygiene Series', '', '', '120 Grams', 'Organic Aloe Vera, Sodium Hyaluronate, Oat Î²-glucan, D-Panthenol, Dipotassium Glycyrrhizinate, Allantoin, Glycerin.', '<div>Highly concentrated natural Aloe Vera with Hyaluronic Acid, doubles the moisture, soothes dehydration, powerful repair! Added Oat Î²-glucan, Allantoin, Vitamin B5 to soothe sensitive skin, also strengthens, self-repairs and protects.</div><div><br></div><div>Moisturizes and soothes dry, rough skin<br></div>', 344, '52009.jpg', 1, 0, 0, 0, 1),
(53003, 'personal', 'Oral Hygiene Series', '', '', '', 'High impact polystyrene + natural charcoal polyester fiber.', 'Charcoal + floss = prevents bacteria, removes odor, dual cleaning effect!<br>Easily slides in-between teeth, does not hurt gums<br>Suitable for children and people with periodontal disease<br>UV sterilized, safe and hygienic<br>Comes with a lightweight carrying case, for convenience any time, anywhere<br>', 394, '53003.jpg', 1, 0, 0, 0, 1),
