(31110, 'personal', 'Personal Hygiene Series', 'NN-1000000887147', 'http://www.fda.gov.ph/consumers-corner/cosmetic-product-notification/366699-NN-1000000887147', '250mL', 'Betaine type surfactant, Pathenol, Vitamin E, hydrolyzed wheat protein, white truffle extract.', '<p>The luxurious fragrance of white truffle is infused into this shower shampoo, which softens your skin, nourishes your stressed body and relaxes your mind.  A truly nourishing and pampering experience!</p>', 332, '31110.jpg', 1, 0, 0, 0, 1),
(31111, 'personal', 'Personal Hygiene Series', 'NN-1000000388477', 'http://www.fda.gov.ph/consumers-corner/cosmetic-product-notification/292184-dlc-go-natural-deep-cleansing-shampoo', '250mL', 'Betaine type surfactants, olive leaf extract, hydrolyzed wheat protein, silk protein, vitamin B5, Lavender essential oil, menthol, Polyquaternium-39', '<p>Specially added Olive leaf extract, hydrolyzed wheat protein, silk protein, menthol and lavender essential oil formula, feeling fresh and pleasant, soothe and nourish your healthy hair. We also use botanical foaming agents, foam so fine, it does not contain chemical additives and silica. Caring of the scalp, nourishing of the hair roots. Makes you feel so refreshing and light after scalp cleansing, hair is supple and full of elasticity.</p>', 333, '31111.jpg', 1, 0, 0, 0, 1),
(31112, 'personal', 'Personal Hygiene Series', 'NN-1000001015109', 'http://www.fda.gov.ph/consumers-corner/cosmetic-product-notification/373745-NN-1000001015109', '250mL', 'Honey essential oil, Aloe-Vera essential oil, Moringa seed extract, Polyquaternium-39, Vitamin B5, Jojoba Oil', '<p>Contains rich honey and Aloe-Vera essential oils. And with the new generation Polyquaternium-39, it repairs hair tips, fully penetrates, moisturizes, increases the softness of hair, makes it more elastic and not easy to break or cause split ends... even the tips are smooth. Miracle Tree\'s Plant-wing seed Moringa extract prevents your hair from dirt contamination, makes your hair shine! With Vitamin B5, Jojoba oil and other essential ingredients, helps strengthens the hair roots, helps hair to effectively hold the moisture and not to become dry. Concentrated and  refined into a semi-thickness consistency, sans silica, let your daily hair care become effortless!</p>', 334, '31112.jpg', 1, 0, 0, 0, 1),
(31113, 'personal', 'Personal Hygiene Series', '', '', '347mL', 'Trehalose, Vitamin E, Rose water, Rose essential oil, Betaine surfactants', '<p><span>â€¢ Added Trehalose</span><br>\r\nNourishing moisturizing ingredients and vitamin E cleanses as it forms a natural protective layer, to prevent tightening and drying of the skin.</p>\r\n<p><span>â€¢ Used Spanish distilled Rose water &amp; Rose essential oil</span><br>\r\nMoisturizing and soothing effect for dry skin</p>\r\n<p><span>â€¢ Natural Plant Extract Foaming agent</span>No soap base, gentle and fine bubbles</p>', 335, '31113.jpg', 1, 0, 0, 0, 0),
(31114, 'personal', 'Personal Hygiene Series', '', '', '347mL', 'White Tea Extract, Jasmine essential oil, Phospholipids, moisturizing glycerin, betaine surfactants', '<p>Newly added skin-nourishing lotion, combines betaine surfactants and mild-cleansing formula to let you experience gentle washing and skin moisturizing at the same time!</p>\r\n<p>Contains extracts of White Tea, Jasmine essential oils, to nourish and protect your delicate skin</p>', 335, '31114.jpg', 1, 0, 0, 0, 0),
(31115, 'personal', 'Personal Hygiene Series', '', '', '120mL', '', 'Hypoallergenic care moisturizing emulsion for sensitive dry skin\r\n<p>Strictly chosen pure natural Borage oil rich in plant sterols and vitamins, combined with precious ceramides, Hyaluronic acid, beeswax and vitamin B5, provides excellent skin repair, softening and moisture-trapping efficiency.</p>\r\n<p>With moisture synergy factors to repair and soothe, leaves your skin soft, firm and smooth.</p>\r\n<p><span>Unique Features:</span></p>\r\n<p><b> Easy repair and maintenance</b><br>\r\nâ€¢ Rich in plant sterols<br>\r\nâ€¢ Borage oil</p>\r\n<p><b> Moisture synergy factors</b><br>\r\nâ€¢ Ceramides<br>\r\nâ€¢ Hyaluronic acid<br>\r\nâ€¢ Allantoin<br>\r\nâ€¢ Vitamin B5</p>', 341, '31115.jpg', 1, 0, 0, 0, 0),
(31116, 'personal', 'Personal Hygiene Series', '', '', '120mL', '', '<span>PentavitinÂ®</span> - the moisture magnet, is a wonder of plant science research and development, 100% natural, plant-derived ingredient with both ECOCERT approval and NATRUE certification.  It attracts moisture from the surroundings, acts as a highly effective moisture regulator resulting in long-lasting water retention in skin.<p>\r\n</p><p>With superior moisture binding and moisture retention action on the skin, effective even in dry air and low humidity environment.</p>\r\n\r\n<p><span>Unique Features:</span></p>\r\n<span class=\"s4\">PentavitinÂ®</span>- Repairs peeling skin<br>\r\n<span class=\"s4\">Idebenone</span>- Reverses skin aging<br>\r\n<span class=\"s4\">Milk Tree Fruit Oil</span>- Refines skin texture<br>\r\n<span class=\"s4\">Temptation Perfume</span>- Enchanting scent', 342, '31116.jpg', 1, 0, 0, 0, 0),
(31201, 'personal', 'Personal Hygiene Series', '', '', '250mL', 'Niacinamide, Panthenol, Tiliacordata flower extract, Hydrolyzed wheat protein, Peppermint essential oil', '<span>For Normal &amp; Thin hair</span>\r\nBeautiful hair begins with a clean scalp! Carefully chosen\r\nhigh quality facial cleansing cream, combined with multiple\r\nscalp-care ingredients, brings out the much-needed vitality, volume and fullness!\r\n<p><span>Purpose:</span> Cleans hair and scalp, adds that much needed volume to thin hair</p>', 336, '31201.jpg', 1, 0, 0, 0, 0),
(31202, 'personal', 'Personal Hygiene Series', '', '', '250mL', 'Panthenol, Chamomile extract, Hydrolyzed wheat protein', '<span>For Dry &amp; Fragile Hair</span><br>\r\nThe worst thing that could happen after coloring your hair would be to lose its color and luster. Color Protective Radiance Shampoo utilizes plant extracts with no harmful chemicals to keep hair color and gently protect damaged or chemically-treated hair from dryness.\r\n<p><span>Purpose:</span> Cleans hair and scalp, as it protects color-treated hair</p>', 336, '31202.jpg', 1, 0, 0, 0, 0),
(31203, 'personal', 'Personal Hygiene Series', '', '', '110mL', 'Hinokitiol, Tilia cordata Flower Extract, Niacinamide, Panthenol, Vitamin B6, Tea tree oil, Peppermint oil, Lavender oil', 'Scalp still oily no matter how much effort you exert to wash your hair? The precious natural hinokitiol blended with various essential oils and Vitamin B is the perfect solution to all your scalp problems!\r\n<p><span>Purpose:</span> Scalp care</p>\r\n<p><span>Directions for use:</span> Use daily, morning or evening. Dry damp hair, spray Nourishing Scalp Spa with Hinokitiol directly on scalp. For long hair, apply section per section on scalp.</p>\r\n<p>For best results, spray directly to scalp, gently massage with fingertips until fully absorbed, no need to rinse afterwards, style hair.</p>', 361, '31203.jpg', 1, 0, 0, 1, 1),
