(35060, 'personal', 'Soap Bars', '', '', '150g x 3 bars', 'Palm kernel oil, Premium Coconut Oil, Sodium Hydroxide, Carica papaya extract, Milk Extract, Prunus dulcis essential oil', 'Our Papaya Soap with Milk boasts of its natural whitening\r\nproperties that moisturizes the skin for smooth, healthy and glowing complexion.', 301, '35060.jpg', 1, 0, 0, 0, 1),
(35061, 'personal', 'Soap Bars', '', '', '150g x 3 bars', 'Palm kernel oil, Premium Coconut Oil, Sodium Hydroxide, Cymbopogon marginatus essential oil, Clinopodium douglasii essential oil, Citrus limonium essential oil', 'The relaxing and refreshing scent of Lemongrass and Yerba Buena deeply cleanses the skin and relieves tired body.', 303, '35061.jpg', 1, 0, 0, 0, 1),
(35062, 'personal', 'Soap Bars', '', '', '150g x 3 bars', 'Palm kernel oil, Premium Coconut Oil, Sodium Hydroxide, Citrus aurantifolia essential oil, Cymbopogon marginatus essential oil, Pogostemon cablin essential oil', 'Especially formulated for oily skin, this refreshing soap can remove excess oil and clear up blemishes as it also whitens the skin.&nbsp;<br>', 305, '35062.jpg', 1, 0, 0, 0, 1),
(35063, 'personal', 'Soap Bars', '', '', '150g x 3 bars', 'Palm kernel oil, Premium Coconut Oil, Sodium Hydroxide, Santalum spicatum essential oil, Aloe barbadensis Mill. essential oil, Lawsonia inermis essential oil, Entada\r\nphaseikaudes K Meer bark bits', 'Enhanced with Gugo bark bits, Aloe Vera extract and Henna essential oil. This specialty shampoo bar nourishes the scalp and adds volume to fine limp hair.', 311, '35063.jpg', 1, 0, 0, 1, 1),
(35064, 'personal', 'Soap Bars', '', '', '150g x 3 bars', 'Palm kernel oil, Premium Coconut Oil, Sodium Hydroxide, Lilium candidum essential oil, Pogostemon cablin essential oil, Cucumis sativus essential oil', 'Discover the unique combination of freshness and nourishing care under the shower. The light fragrant scent of White Lily and Patchouli leaves your skin sweet-smelling and richly moisturized.', 307, '35064.jpg', 1, 0, 0, 0, 1),
(35065, 'personal', 'Soap Bars', '', '', '150g x 3 bars', 'Palm kernel oil, Premium Coconut Oil, Sodium Hydroxide, Psidium guajava essential oil, Cucumis sativus essential oil', 'The rich, moisturizing ingredients of Guava and Cucumber nourishes and smoothens your skin, leaving a light refreshing scent.', 309, '35065.jpg', 1, 0, 0, 0, 1),
(35066, '', '', '', NULL, '', '', '', 999, '', 1, 0, 0, 0, 0),
(35067, 'personal', 'Soap Collection', '', '', '150g x 3 bars', '3 soap bars<br>\r\n1 Papaya with Milk<br>\r\n1 Lemongrass with Yerba Buena<br>\r\n1 Sunburst Lime with Citronella', 'Soothe the mind, body and soul with specially formulated soaps from DLC. Crafted with natural ingredients such as soothing white lily, pure essential oils of papaya or guava and healthy doses of vitamin-rich plant extracts, our all-natural soaps moisturize and pamper skin while lifting the senses, giving you a feeling of good health and well-being ...\r\n\r\n<p><span>Features of Naturelles</span></p>\r\n\r\n<p><span>ALL NATURAL and 0% Preservatives</span><br>\r\nOur natural soaps feature only premium essential oils and natural plant extracts to help rejuvenate, nourish and purify the skin. We assure you that none of these hazardous or synthetic ingredients such as parabens, sulfates, propylene glycol and synthetic colorants will touch your skin.</p>\r\n\r\n<p><span>100% Essential Oils</span><br>\r\nThe benefits of 100% essential oils with natural ingredients create a holistic approach to care for the senses and skin. Each variant is a sensory experience, simply created to let you enjoy a moment of serenity, clarity and luxury.</p>\r\n\r\n<p><span>The Purest of Ingredients</span><br>\r\nMade only from the finest ingredients, we created a naturally inspired collection of soaps for cleansing and moisturizing to keep your body healthy, energized and beautiful.</p>\r\n\r\n<p><span>Unique-patented floral mold</span><br>\r\nWith an eye for detail and craftsmanship, we carefully\r\ndesigned our soaps to minimize contact with water for longer use and enjoyment.</p>\r\n\r\n<p><span>Triple-milled</span><br>\r\nOur famous triple-milled soap are rich, luxurious, elegantly scented and long-lasting to nourish your skin and pamper your senses.</p>\r\n\r\n<p><span>6 Variants suitable for all skin-types</span><br>\r\nOur 6 variants were meticulously chosen to suit whatever your skin type is and enhance your bathing experience... making you feel pampered, nourished and moisturized.</p>', 322, '35067.jpg', 1, 0, 0, 0, 1),
