(35074, 'health', 'Functional Food', 'FR-97509', '', '15g/sachet, 12 sachets/box', 'Sugar, Non-dairy Creamer, Coffee Powder, Antrodia Cinnamomea', '<p>Our quest for the premium coffee sends us to the peak of Taiwan\'s highest mountains to acquire the country\'s most precious gem, Antrodia Cinnamomea, the National Treasure of Taiwan. Antrodia Cinnamomea is a mushroom exclusively available in Taiwan, also known as <b>\"Ruby in Mushroom\"</b>. Part science, part art, our process carefully takes each coffee pack to its peak of flavor and aroma.</p>\r\n<p><span>Preparation:</span> Empty contents into a cup. Add approximately 150mL (5.3 fl. oz) of water and stir well.</p>', 280, '35074.jpg', 1, 0, 0, 0, 0),
