(35079, 'personal', 'Soap Bars', 'NN-20131127143616', 'http://www.fda.gov.ph/cosmetic-product-notification/127340-nn-20131127143616', '150g x 3 bars', 'Palm kernel oil, Premium Coconut Oil, Sodium Hydroxide, Santalum spicatum essential oil, Aloe barbadensis Mill. essential oil, Lawsonia inermis essential oil, Entada\r\nphaseikaudes K Meer bark bits', 'Enhanced with Gugo bark bits, Aloe Vera extract and Henna essential oil. This specialty shampoo bar nourishes the scalp and adds volume to fine limp hair.', 311, '35079.jpg', 1, 0, 0, 0, 1),
(35080, 'personal', 'Soap Bars', 'NN-20131127143522', 'http://www.fda.gov.ph/cosmetic-product-notification/127339-nn-20131127143522', '150g x 3 bars', 'Palm kernel oil, Premium Coconut Oil, Sodium Hydroxide, Lilium candidum essential oil, Pogostemon cablin essential oil, Cucumis sativus essential oil', 'Discover the unique combination of freshness and nourishing care under the shower. The light fragrant scent of White Lily and Patchouli leaves your skin sweet-smelling and richly moisturized.', 307, '35080.jpg', 1, 0, 0, 0, 1),
(35081, 'personal', 'Soap Bars', 'NN-20131128145616', 'http://www.fda.gov.ph/cosmetic-product-notification/127401-nn-20131128145616', '150g x 3 bars', 'Palm kernel oil, Premium Coconut Oil, Sodium Hydroxide, Psidium guajava essential oil, Cucumis sativus essential oil', 'The rich, moisturizing ingredients of Guava and Cucumber nourishes and smoothens your skin, leaving a light refreshing scent.', 309, '35081.jpg', 1, 0, 0, 0, 1),
