(35106, 'health', 'Functional Food', 'FR-97509', '', '1Kilo/pack with 80cups', 'Sugar, Non-dairy Creamer, Coffee Powder, Antrodia Cinnamomea', '<p>Our quest for the premium coffee sends us to the peak of Taiwan\'s highest mountains to acquire the country\'s most precious gem, Antrodia Cinnamomea, the National Treasure of Taiwan. Antrodia Cinnamomea is a mushroom exclusively available in Taiwan, also known as <b>\"Ruby in Mushroom\"</b>. Part science, part art, our process carefully takes each coffee pack to its peak of flavor and aroma.</p>', 280, '35106.jpg', 1, 0, 0, 0, 0),
(35107, 'personal', 'Hand Sanitizer', 'NN-2013041811153', '', '30mL x 3', 'Ethyl Alcohol, Antibacterial Agent, Sunburst Lime Extract, Natural Fragrance', 'Coco-based Monolaurin with Sunburst Lime extract for more effective protection against germs and bacteria-causing diseases.<br><br>\r\nLess alcohol â€¢ Non-drying', 346, '35107.jpg', 1, 0, 0, 0, 1),
(35108, 'health', 'Functional Food', '', '', '15g/sachet, 12 sachets/box', 'Non-dairy Creamer, Coffee Powder, Antrodia Cinnamomea', 'Our quest for the premium coffee sends us to the peak of Taiwan\'s highest mountains to acquire the country\'s most precious gem, Antrodia Cinnamomea, the National Treasure of Taiwan. Antrodia Cinnamomea is a mushroom exclusively available in Taiwan, also known as <b>\"Ruby in Mushroom\"</b>. Part science, part art, our process carefully takes each coffee pack to its peak of flavor and aroma.\r\n<p><span>Preparation:</span> Empty contents into a cup. Add approximately 150mL (5.3 fl. oz) of water and stir well.</p>', 280, '35108.jpg', 1, 0, 0, 0, 0),
(35111, 'personal', 'Soap Travel Size', 'NN-1000003877497', 'https://ww2.fda.gov.ph/index.php/consumers-corner/cosmetic-product-notification/546711-NN-1000003877497', '150g x 3 bars / 24 slices', 'Palm kernel oil, Premium Coconut Oil, Sodium Hydroxide, Carica papaya extract, Milk Extract, Prunus dulcis essential oil', 'Our Papaya Soap with Milk boasts of its natural whitening properties that moisturizes the skin for smooth, healthy and glowing complexion.&nbsp;<br>', 302, '35111.jpg', 1, 0, 0, 0, 1);

